content:
@andrewsmhay It is very active and much more pleasant than this dumpster fire for many (but not all) people.
But this still has critical mass. 
I rarely even look here, and usually only post a few times a month to keep the account from being tagged inactive.

@FRAInfoStudent @khaxan Yup. 
"Uh, park it right there, I guess."
Some day I'll take one of the Urals somewhere with valet-only parking just to see their minds melt.

@Bbat_fixit Indeed, the people who need help to most can't get it, in both cases.

Glad US healthcare isn't like that, that would be terrible. Imagine, no insurance (or crappy insurance) and no cash reserves, would mean poor or no treatment.
/me weeps in rage

@Jose_Pagliery Thanks for all your work.
Time for milk and cookies.
Or possibly something stronger.

@iot7712 Oh yeah, one of my favorite planes lives with the carving tools, so wasn't in that set.
Millers Falls Tools of Greenfield, Mass.
Blade is made of pure unobtainium as far as I can tell, incredibly hard but not brittle, and holds an edge. https://t.co/3vd9k1MzdM

@NunesAlt I've seen too much.
And yet, I can't completely give up.
Yet.

@andreasdotorg Yes, but I still worry about collateral damage.
I'm no Abe Lincoln, not authorizing nonviable casualties on my watch.
Yet.

@Shatter242 Good idea.
A splash of acetone on the Styrofoam before the gas will make for more thorough dissolution and a more even mixture.
So I've heard.

@ClaireTills @Caiwrote @marasawr Love at First Bite.
Although there may have been chemicals in my system that made it far funnier than it really was.
Hash is not just for passwords.

@wbm312 I am simultaneously over- and under-whelmed, by everything and nothing.
#meh 
Also, miss you.üíú

@justthisguy @DeemonSecurity I only trust the boring, conservative, but reliable @NWS forecasts. Too many years living on the coast and sailing to trust anyone else.
As was (not quite) said in Princess Bride, "Never go against the NWS when death is on the line"
Honorable mention to @CARROT_app, though.

@Latitude29_NOLA Welp, we're coming for Christmas, but I guess we're going to see you next week, too.
What's 1200 miles (round trip) between friends?
@SufferinBa5tard will get a fresh coat of Tung oil in preparation.

@brownteaming It's like a stairway to 
some kind of celestial place 

