@hiphippie Health matters.
Joy matters more.
Even small joys.

@hiphippie Did they make you happy?
If so, how can something as trivial as calories count?

(Within reason, of course)

@hacks4pancakes I consider myself an outfluencer. As in:
"Get out while you still can."

Perhaps this is why you need an agent, and I do not.

@blenster When you send love into the world it often comes back when you need it.

Not always, to be sure.

But I'm thrilled it is coming back to you now.

